webpackJsonp([0x7482a59a896d],{412:function(A,e){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="lands end park"\n        title=""\n        src="/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-631b1.jpg"\n        srcset="/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-30fbd.jpg 200w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-e87dc.jpg 400w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-631b1.jpg 800w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-300e3.jpg 1200w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-c15ef.jpg 1600w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-3a622.jpg 2400w,\n/static/banner-03aafc6ecfadc50f69394af1a85b1bbf-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4><a href="https://www.nps.gov/goga/planyourvisit/landsend.htm">Lands End Park</a></h4>\n<p>Things have calmed down a lot since I talked to you last.  Although I\'ve only been here for two weeks, I already feel like I\'m settling in.</p>\n<p>There\'s not too much new or crazy to talk about this week, but that\'s okay.</p>\n<p>Work is awesome, I committed my first piece of code on our project, learned a ton about Ruby on Rails and got a high level overview about how the payments industry works.</p>\n<p>Fun Fact: If you\'ve ever wondered how <a href="https://venmo.com/">Venmo</a> makes money, spoiler alert: they don\'t.</p>\n<p>Outside of work I\'ve been busy biking, exploring, and watching warriors games on our rooftop.</p>\n<h2>Life</h2>\n<p>I\'ve noticed I have a tendency to sometimes keep my schedule overly regimented.  On one hand, it\'s great for productivity, but we all need a little spontaneity in our lives.</p>\n<p>Most days I get up, go to the gym, bike to work and spend the day coding and learning from cool people.  Then I bike home, cook dinner, hangout with my roommates, read, and go to bed.  This is a slight exaggeration, but in general it\'s fairly accurate.</p>\n<p>It\'s a wonderful life, but it can be easy to feel like you\'re living inside a bubble.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="roof"\n        title=""\n        src="/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-631b1.jpg"\n        srcset="/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-30fbd.jpg 200w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-e87dc.jpg 400w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-631b1.jpg 800w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-300e3.jpg 1200w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-c15ef.jpg 1600w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-3a622.jpg 2400w,\n/static/roof2-03c0b48f3d892b97f25ffaae3cd56d8e-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>It\'s not a bad life... (view from my roof)</h4>\n<p>I really reading enjoyed <a href="http://www.npr.org/sections/alltechconsidered/2017/06/08/531796329/eager-to-burst-his-own-bubble-a-techie-made-apps-to-randomize-his-life">this NPR story</a> (thanks dad) about a software engineer at google who decided to create apps for himself to force him to introduce spontaneity into his life.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="egg"\n        title=""\n        src="/static/egg-d2c8894f8010c40d8d915f3a24455e34-631b1.jpg"\n        srcset="/static/egg-d2c8894f8010c40d8d915f3a24455e34-30fbd.jpg 200w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-e87dc.jpg 400w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-631b1.jpg 800w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-300e3.jpg 1200w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-c15ef.jpg 1600w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-3a622.jpg 2400w,\n/static/egg-d2c8894f8010c40d8d915f3a24455e34-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Everything is better with an egg on top.</h4>\n<p>I think my favorite part was his stories about attending random Facebook events that were accidentally made public.</p>\n<p>Now, I\'m probably not going to adopt quite the same lifestyle, but I think it serves as a valuable lesson.  It\'s easy to get sucked into a bubble where we spend all of our time with the people that are most similar to us.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Amazon Alexa Meetup"\n        title=""\n        src="/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-631b1.jpg"\n        srcset="/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-30fbd.jpg 200w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-e87dc.jpg 400w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-631b1.jpg 800w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-300e3.jpg 1200w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-c15ef.jpg 1600w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-3a622.jpg 2400w,\n/static/alexa-c8cca4caad3f2d138b4d7c04c66c6dee-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4><a href="https://www.meetup.com/SF-Amazon-Alexa/events/239733405/?comment_table_id=252723127&#x26;comment_table_name=reply">Amazon Alexa San Francisco Meetup</a>.  Not "crazy" but still fun.</h4>\n<p>Sometimes the most rich experiences in life are just outside our comfort zone.  Hopefully I can update you in the coming weeks about some weird or crazy event that I went to.</p>\n<p>Or it could be something as simple going to an open event without knowing anyone.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Rooftop views"\n        title=""\n        src="/static/roof-e9e3288ee8847b2e307803e305b33979-631b1.jpg"\n        srcset="/static/roof-e9e3288ee8847b2e307803e305b33979-30fbd.jpg 200w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-e87dc.jpg 400w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-631b1.jpg 800w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-300e3.jpg 1200w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-c15ef.jpg 1600w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-3a622.jpg 2400w,\n/static/roof-e9e3288ee8847b2e307803e305b33979-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>More rooftop views.</h4>\n<p>I\'m keeping it short this week, but I\'ll be back with a more in-depth update next week.  In the mean time check out a few of my favorite links I listened/watched/read this week.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="golden gate bridge"\n        title=""\n        src="/static/bridge-760f790a101870e8a1b7eb1f5878c59f-631b1.jpg"\n        srcset="/static/bridge-760f790a101870e8a1b7eb1f5878c59f-30fbd.jpg 200w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-e87dc.jpg 400w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-631b1.jpg 800w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-300e3.jpg 1200w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-c15ef.jpg 1600w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-3a622.jpg 2400w,\n/static/bridge-760f790a101870e8a1b7eb1f5878c59f-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h2>Links</h2>\n<ul>\n<li>\n<p><a href="http://tim.blog/2017/06/04/nick-szabo/">The Quiet Master of Cryptocurrency — Nick Szabo</a><br>\nOne of the best podcasts I\'ve listened to in a long time.  If you\'re like me, you\'ve heard people talk about bitcoin, ethereum, "the block chain", "social contracts", "mining", etc, and had no idea what they were talking about.  People have been talking about bitcoin as the future for awhile now, yet the vast majority of people (even most of the people investing) have little or no idea of what exactly bitcoin is, how it works, and why it is potentially useful.  This podcast is a fantastic introduction to anyone trying to get a better understanding of cryptocurrency.</p>\n</li>\n<li>\n<p><a href="https://medium.com/the-wtf-economy/do-more-what-amazon-teaches-us-about-ai-and-the-jobless-future-8051b19a66a">Do More! What Amazon Teaches Us About AI and the “Jobless Future”</a><br>\nThe core argument of this article is that the best applications of technology actually create jobs by allowing us to do more.  Growth in employees at amazon continues to skyrocket even with additional use of robots and A.I.  I love the optimism, especially in an area where experts are quick to predict the worst. But, there are also plenty of counterexamples to Tim\'s argument as well.  Regardless, it\'s an interesting read about the crazy time we\'re all living in.</p>\n</li>\n<li>\n<p><a href="https://www.youtube.com/watch?v=oqifKYx3gc4&#x26;t=90s">67 Questions with a Lyft Data Scientist</a></p>\n</li>\n</ul>',frontmatter:{path:"/interning-in-sf-week-2",title:"Getting outside the bubble (Interning in San Francisco Week 2)",date:"06-11-2017",tag:"Life"}}},pathContext:{}}}});
